(4991, 0, '53', 'click åœ¨çº¿ç”¨æˆ· again', '2011-06-18 02:38:05', 1, 1, 1308364685, '0', '54'),
(4992, 0, '53', 'but I will make a close button soon', '2011-06-18 02:38:15', 1, 1, 1308364695, '0', '54'),
(4993, 0, '53', 'so my idea is to having people interacting with each other in such a way, so they will feel more real and fun', '2011-06-18 02:39:50', 1, 1, 1308364790, '0', '54'),
(4994, 0, '54', 'i see', '2011-06-18 02:40:31', 1, 1, 1308364831, '0', '53'),
(4995, 0, '54', 'lol, i walk right through you', '2011-06-18 02:41:00', 1, 1, 1308364860, '0', '53'),
(4996, 0, '53', 'yes', '2011-06-18 02:41:05', 1, 1, 1308364865, '0', '54'),
(4997, 0, '53', 'you can', '2011-06-18 02:41:11', 1, 1, 1308364871, '0', '54'),
(4998, 0, '54', 'the update isn&#039;t that smooth', '2011-06-18 02:43:55', 1, 1, 1308365035, '0', '53'),
(4999, 0, '53', 'yes, I know', '2011-06-18 02:44:02', 1, 1, 1308365042, '0', '54'),
(5000, 0, '53', 'some times it&#039;s lagging', '2011-06-18 02:44:12', 1, 1, 1308365052, '0', '54'),
(5001, 0, '53', 'so what I did is to use settimeinterval in js', '2011-06-18 02:45:13', 1, 1, 1308365113, '0', '54'),
(5002, 0, '53', 'to keep track of the other users movements', '2011-06-18 02:45:28', 1, 1, 1308365128, '0', '54'),
(5003, 0, '54', 'oh my', '2011-06-18 02:46:44', 1, 1, 1308365204, '0', '53'),
(5004, 0, '54', 'it&#039;s really chatty too', '2011-06-18 02:46:59', 1, 1, 1308365219, '0', '53'),
(5005, 0, '54', '6 requests /sec', '2011-06-18 02:47:23', 1, 1, 1308365243, '0', '53'),
(5006, 0, '53', 'yes', '2011-06-18 02:48:27', 1, 1, 1308365307, '0', '54'),
(5007, 0, '54', 'i think the idea is good, but you&#039;ll need to make it a bit scalable', '2011-06-18 02:48:39', 1, 1, 1308365319, '0', '53'),
(5008, 0, '53', 'I set it each time interval to 500ms', '2011-06-18 02:49:03', 1, 1, 1308365343, '0', '54'),
